import React from "react";
import { GoogleLogin } from 'react-google-login';

const clientId = '1037231150604-3nupod2kv8d1p56lcrj6dlbs8aocl2jq.apps.googleusercontent.com'

export default class Login extends React.Component {

  login = () => {

    const onSuccess = ( res ) => {
      console.log('[Login Success] currentUser:', res.profileObj)
    }

    const onFailure = ( res ) => {
      console.log('[Login failed] res:', res)
    }

  }

  render() {


    return (
      <React.Fragment>
      <div>
      <GoogleLogin
      clientId={clientId}
      buttonText="Login"
      onSuccess={onSuccess}
      onFailure={onFailure}
      cookiePolicy={'single_host_origin'}
      style={{ marginTop: '180px' }}
      isSignedIn={true}
      />
      <p>Hey!</p>
      </div>
      </React.Fragment>
    )
  }
}
